// @author       Alyssa Cohen
// @match        https://www.xdress.it/xdforum/mchat.php*
// @exclude      https://www.xdress.it/xdforum/mchat.php?archive.php
// @require      http://code.jquery.com/jquery-3.3.1.js
// @grant        none
//
// ==/UserScript==

var MutationObserver = window.MutationObserver;
var myObserver = new MutationObserver (mutationHandler);
var obsConfig = {
    childList: true, attributes: true,
    subtree: true, attributeFilter: ['class']
};

myObserver.observe (document, obsConfig);

function mutationHandler (mutationRecords) {

    mutationRecords.forEach ( function (mutation) {

        if (mutation.type == "childList"
            && typeof mutation.addedNodes == "object"
            && mutation.addedNodes.length
        ) {
            for (var J = 0, L = mutation.addedNodes.length; J < L; ++J) {
                checkForCSS_Class (mutation.addedNodes[J], "mChatHover");
            }
        }
        else if (mutation.type == "attributes") {
            checkForCSS_Class (mutation.target, "mChatHover");
        }
    } );
}

function checkForCSS_Class (node, className) {
    //-- Only process element nodes
    if (node.nodeType === 1) {
        if (node.classList.contains (className) ) {
            console.log (
                'New node with class "' + className + '" = ', node
            );
            // YOUR CODE HERE
            //GM_log ('nav creation');
            //alert ('new message!');
            var audio = new Audio("data:audio/ogg;base64,");
            audio.play();
        }
    }
}
